import React, { useState } from 'react';
import './App.css';
import create_header from './assets/components/header';
import create_background from './assets/components/background';

function App() {
    return (
      <div className="App">
        <header className="App-header">
            {create_background()}
            {create_header()}
        </header>
      </div>
    );
  }
export default App;
